import { Component, OnInit } from '@angular/core';
import { FormGroup, FormControl, Validators } from '@angular/forms';
import {UserServiceService} from '../../services/user-service.service'
import {User} from '../data/user'
import { Observable,of, of as observableOf } from 'rxjs'; // since RxJs 6
import { ActivatedRoute, Router } from '@angular/router';
import { first } from 'rxjs/operators';
import { AuthenticationService } from 'app/services/authentification.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss']
})
export class LoginComponent implements OnInit {
  loginForm = new FormGroup({
    username: new FormControl('',[
    Validators.email

    ]),
    password: new FormControl('',
    [Validators.required,
    Validators.minLength(6)
  ])
  });
  user?:User;
  imgURL:any;
  message$!: Observable<User>;
  error: any;
  loading!: boolean;
  users!: User[];
  constructor(private authenticationService: AuthenticationService
    ,private userService: UserServiceService,
    private router: Router) {
      if (this.authenticationService.currentUser) { 
        this.router.navigate(['/table']);
    }
     }

  ngOnInit(): void {
     this.imgURL="data:image/png;base64,";
     this.loadAllUsers();
  }
  onSubmit() {
    this.authenticationService.login(this.loginForm.getRawValue()).pipe(first())
    .subscribe(
        data => {
        this.router.navigateByUrl('/table');
         
        },
        error => {
            this.error = error;
            this.loading = false;
        });;
  }
  private loadAllUsers() {
    let aux=this.userService.getAll().pipe(first()).subscribe(
      
      data => {
        this.users=data
         
        },
        error => {
            this.error = error;
            this.loading = false;
        });;
}

}
